import React, {Component} from 'react'
import {Jumbotron} from 'react-bootstrap';

import '../App.css'
import '../css/bootstrap.css';

class IntroJumbo extends Component {
  render() {
    return (
            <Jumbotron>
              <center>
              <h1 className="display-3">Universidad Central del Ecuador</h1>
              </center>
              <p className="lead"> Propuesta para un modelo de sistematizacion en la gestion de derechos de autor
              aplicando Smart COntracts sobre una plataforma basada en Blockchain, para publicaciones cientificas.</p>
              </Jumbotron>
    );
  }
}

export default IntroJumbo
